import React from 'react'

const Footer = () => {
    return (
      <>
        <footer className="main-footer">
        <strong>Copyright &copy; 2021</strong> All rights reserved.
        </footer>
        <aside className="control-sidebar control-sidebar-dark"></aside>

      </>
    );
}

export default Footer
